import React from "react";

export default function DogInfo({ pup }) {

  const goodDog = (pup) => {
    return pup.isGood
  }

  return (
    <div id="dog-info">
      <img src={pup.image} alt={pup.name + "puppy"} />
      <h2>{pup.name}</h2>
  <button>{this.goodDog()}</button>
    </div>
  );
}
